class AestheicalTrees {

	@Test
	void test() {
//		assertFalse(this.isAestheticallyPleasing(new int[] {3,4,5,3,7}));
//		assertFalse(this.isAestheticallyPleasing(new int[] {1,2,3,4}));
//		assertTrue(this.isAestheticallyPleasing(new int[] {1,3,1,2}));
		
		assertEquals(3, this.solution(new int[] {3,4,5,3,7}));
		assertEquals(-1, this.solution(new int[] {1,2,3,4}));
		assertEquals(0, this.solution(new int[] {1,3,1,2}));
	}

	private int solution(int[] A) {
		int counter = 0;
		
		
		if (this.isAestheticallyPleasing(A)) {
			return 0;
		}
		
		for (int i = 0; i< A.length; i++) {
			List<Integer> aList = new ArrayList<Integer>();
			
			for (int j = 0; j < A.length; j++) {
				aList.add(A[j]);
			}
			
			aList.remove(i);
			
			int[] B = new int[aList.size()];
			
			for (int j = 0; j < aList.size(); j++) {
				B[j] = aList.get(j);
			}
			
			if (isAestheticallyPleasing(B)) {
				counter++;
			}
		}
		
		return counter == 0 ? -1: counter;
	}

	private boolean isAestheticallyPleasing(int[] A) {

		DIRECTION nextDirection = null;

		for (int i = 0, j = i + 1; i < A.length - 1 && j < A.length; i++, j++) {
			
			int current = A[i];
			int next = A[j];
			
			if (current == next) {
				return false;
			}
			
			if (i == 0) {
				nextDirection = determineNextDirection(current, next);
				continue;
			}
			
			if (nextDirection == DIRECTION.DOWN && current < next) {
				return false;
			} else if ( nextDirection == DIRECTION.UP && current > next) {
				return false;
			}
			
			nextDirection = determineNextDirection(current, next);
		}
		
		return true;
	}

	private DIRECTION determineNextDirection(int current, int next) {
		DIRECTION nextDirection;
		if (current > next) {
			nextDirection = DIRECTION.UP;
		} else {
			nextDirection = DIRECTION.DOWN;
		}
		return nextDirection;
	}

	enum DIRECTION {
		UP, DOWN;
	}
}
